import './App.css';
import React, { useState } from 'react';


function App() {
    const [notes, setNotes] = useState(['a', 'b', 'c', 'd', 'e']);
    const [value, setValue] = useState(" ");
    const map = notes.map((elem, index) => {
         return <li key = {index}>{elem}</li>
    })  


    function func () {
        setNotes ([...notes, value]);
        setValue(" ");
    }

    return <div>
        <input value = {value} onChange = {(event) => setValue(event.target.value)} onBlur = {func} />
        <ul>
            {map}
        </ul>

    </div>

}
export default App;
